import React from 'react';
import { Layout as AntLayout } from 'antd'
import Header from './Header';

const Layout = props => {
    return (
        <AntLayout>
            {/* <Header></Header> */}
            {props.children}
        </AntLayout>
    );
}

export default Layout;
